import { NavbarBrand } from 'react-bootstrap';
import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';
import Form from 'react-bootstrap/Form';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';

function NavSc() {
  return (
    <Navbar bg="light" expand="lg" className="shadow bg-light border-primary text-center">
      <Container fluid>
        <Navbar.Brand>
            <img src="https://drive.google.com/file/d/1f0fjvbbiDeGIdFeJMi8dQjyttgoVf9sJ/view?usp=share_link" width="" height="" alt=""/>
        </Navbar.Brand>
        <Navbar.Brand href="#">RESERVAS+</Navbar.Brand>
        <Navbar.Toggle aria-controls="navbarScroll" />
        <Navbar.Collapse id="navbarScroll">
          <Nav
            className="me-auto my-2 my-lg-0"
            style={{ maxHeight: '100px' }}
            navbarScroll
          > 
            <Nav.Link href="../">Menu</Nav.Link>
            <Nav.Link href="#">Contate-nos</Nav.Link>
            <Nav.Link href="#">Sobre n√≥s</Nav.Link>
            <NavDropdown title="Link" id="navbarScrollingDropdown">
              <NavDropdown.Item href="../funcionarios">Funcionarios</NavDropdown.Item>
              <NavDropdown.Item href="../clientes">
                Clientes
              </NavDropdown.Item>
              <NavDropdown.Divider />
              <NavDropdown.Item href="../salas">
                Salas
              </NavDropdown.Item>
            </NavDropdown>
            <Nav.Link href="#" disabled>
              Em breve...
            </Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default NavSc;
